- input: "TEXT\x1CC00001917\x1CTEXT-00001\x1C\x1CF3XA\x1CThe Wyoming Democratic State
    Central Committee is in receipt of the Commission's letter of Jan. 20, 2010, referencing
    our Amended September Monthly Report (8/1/09-8/31/09), filed 12/29/09, and we
    reply as follows:    Regarding item 1: In May 2009 and in June 2009, we erroneously
    listed H3 transfers from the Wyoming Democratic Party NonFederal Account on Line
    12 instead of properly listing them on Line 18(a). When these errors came to our
    attention, we corrected them, making said corrections after Dec. 18, 2009, but
    before Dec. 28, 2009. As a result, every new report we filed beginning with our
    June Monthly Report (5/1/09-5/31/09) and ending with our December Monthly Report
    (11/1/09-11/30/09) had inaccurate year-to-date totals on Lines 12, 18(a), 18(c)
    and 20, Column B, and we had inaccurate totals on the same lines in Column A on
    our original June Monthly Report (5/1/09-5/31/09) and on our original July Monthly
    Report (6/1/09-6/30/09). We have already filed amended reports for some of those
    months, with corrected totals on those lines, and today we are amending the remaining
    reports, such that all of the most recent amended versions of the reports for
    2009 will be accurate. In short, the totals listed in the Amended September Monthly
    Report that we filed on 12/29/09 are correct, but totals on our August Monthly
    Report (7/1/09-7/31/09) are inaccurate, so we will amend that report immediately.
    \   Regarding item 2: We have amended the report to identify the full name of
    the NonFederal Account from which the $13,434 transfer was made.  \n"
